import React from 'react'
import './style/display.css'


class Display extends React.Component {

    findmovie(movie) {
        fetch("http://localhost:9000/find/" + movie)
        .then(res => res.json())
        .then((data) => {
          console.log(data)
        })
      }
    render() {

        const items = [];

        for (const [index, value] of this.props.movie.entries()) {
            items.push(<div key={index}>{value}</div>)
          }
        return(
        <div className="display" id="display">
            {items}
            {this.findmovie(this.props.movie)}
       </div>
         )}

}

export default Display
